CREATE DEFINER=`root`@`localhost` PROCEDURE `anular_factura` (IN `no_factura` INT)  BEGIN
     
        DECLARE existe_factura int;
        DECLARE registros int;
        DECLARE a int;
        
        DECLARE cod_producto int;
        DECLARE cant_producto int;
        DECLARE existencia_actual int;
        DECLARE nueva_existencia int;
      
        SET existe_factura = (SELECT COUNT(*) FROM tvenn_tts WHERE tvent_idvent = no_factura);
        
        IF existe_factura > 0 THEN 
        
           CREATE TEMPORARY TABLE tbl_tmp (
               id BIGINT NOT NULL AUTO_INCREMENT PRIMARY KEY,
               cod_prod BIGINT,
               cant_prod int);
               
               SET a = 1;
               
               SET registros = (SELECT COUNT(*) FROM tdevt_tts WHERE tdven_fkidvt = no_factura);
               
               IF registros > 0 THEN 
               
                   INSERT INTO tbl_tmp(cod_prod,cant_prod) SELECT tdven_fkcodp,tdven_cantpr FROM tdevt_tts WHERE tdven_fkidvt = no_factura;
                   
                   WHILE a <= registros DO
                   
                      SELECT cod_prod,cant_prod INTO cod_producto,cant_producto FROM tbl_tmp WHERE id = a;
                      SELECT tprod_cantpr INTO existencia_actual FROM tprod_tme WHERE tprod_idprod = cod_producto;
                      SET nueva_existencia = existencia_actual + cant_producto;
                      UPDATE tprod_tme SET tprod_cantpr = nueva_existencia WHERE tprod_idprod = cod_producto;
                      
                      SET a=a+1;
                   END WHILE;
                   
                   UPDATE tvenn_tts SET tvent_status = 'Anulada' WHERE tvent_idvent = no_factura;
                   DROP TABLE tbl_tmp;
                   SELECT * FROM tvenn_tts WHERE tvent_idvent = no_factura;
               
               END IF;
        
        ELSE
        
           SELECT 0 factura;
           
        END IF;
     
     END$$

