CREATE DEFINER=`root`@`localhost` PROCEDURE `procesar_compra_manual` (IN `cod_usuario` INT, IN `cod_proveedor` INT, IN `token` VARCHAR(50), IN `nofactura` INT)  BEGIN
           DECLARE factura int;
           DECLARE registros int;
           DECLARE total decimal(10,2);

           DECLARE nueva_existencia int;
           DECLARE existencia_actual int;

           DECLARE tmp_cod_producto varchar (30);
           DECLARE tmp_cant_producto int;
           DECLARE a int;
           SET a = 1;

           CREATE TEMPORARY TABLE tbl_tmp_tokenuser(
               id bigint NOT NULL AUTO_INCREMENT PRIMARY KEY,
               cod_prod varchar (30),
               cant_prod int);
               
           SET registros = (SELECT COUNT(*) FROM tdtec_tts WHERE tdtec_tokuse = token);
           
           IF registros > 0 THEN
           
               INSERT INTO tbl_tmp_tokenuser(cod_prod,cant_prod) SELECT tdtec_idprod,tdtec_cantid FROM tdtec_tts WHERE tdtec_tokuse = token;

               INSERT INTO tcomp_tts(tcomp_numfac,tcomp_userco,tcomp_fkprov) VALUES (nofactura,cod_usuario,cod_proveedor);
               SET factura = LAST_INSERT_ID(); 

               INSERT INTO tdcom_tts(tdcom_fkidco,tdcom_fkprod,tdcom_cantid,tdcom_precio) SELECT (factura) as tdcom_fkidco, tdtec_idprod, tdtec_cantid, tdtec_precic FROM tdtec_tts                  WHERE tdtec_tokuse = token;

               WHILE a <= registros DO
               
                    SELECT cod_prod,cant_prod INTO tmp_cod_producto,tmp_cant_producto FROM tbl_tmp_tokenuser WHERE id = a;
                    SELECT tprod_cantpr INTO existencia_actual FROM tprod_tme WHERE tprod_idprod = tmp_cod_producto;

                    SET nueva_existencia = existencia_actual + tmp_cant_producto;
                    UPDATE tprod_tme SET tprod_cantpr = nueva_existencia WHERE tprod_idprod = tmp_cod_producto;

                    SET a=a+1;

               END WHILE;

               SET total = (SELECT SUM(tdtec_cantid * tdtec_precic) FROM tdtec_tts WHERE tdtec_tokuse = token);
               UPDATE tcomp_tts SET tcomp_totalc = total WHERE tcomp_idcomp = factura;
               
               UPDATE tdcom_tts SET tdcom_Subtot = total WHERE tdcom_fkidco = factura;
               
               DELETE FROM tdtec_tts WHERE tdtec_tokuse = token;
               TRUNCATE TABLE tbl_tmp_tokenuser;
               SELECT * FROM tcomp_tts WHERE tcomp_idcomp = factura;
           ELSE
               SELECT 0;
           END IF;
      END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `procesar_venta_manual` (IN `cod_usuario` VARCHAR(10), IN `cod_cliente` INT, IN `token` VARCHAR(50))  BEGIN
           DECLARE factura int;
           DECLARE registros int;
           DECLARE total decimal(10,2);

           DECLARE nueva_existencia int;
           DECLARE existencia_actual int;

           DECLARE tmp_cod_producto varchar (30);
           DECLARE tmp_cant_producto int;
           DECLARE a int;
           SET a = 1;

           CREATE TEMPORARY TABLE tbl_tmp_tokenuser(
               id bigint NOT NULL AUTO_INCREMENT PRIMARY KEY,
               cod_prod varchar (30),
               cant_prod int);
               
           SET registros = (SELECT COUNT(*) FROM tdtem_tts WHERE tdtem_tokuse = token);
           
           IF registros > 0 THEN
           
               INSERT INTO tbl_tmp_tokenuser(cod_prod,cant_prod) SELECT tdtem_idprod,tdtem_cantid FROM tdtem_tts WHERE tdtem_tokuse = token;

               INSERT INTO tvenn_tts(tvent_uservt,tvent_fkclie) VALUES (cod_usuario,cod_cliente);
               SET factura = LAST_INSERT_ID();

               INSERT INTO tdevt_tts(tdven_fkidvt,tdven_fkcodp,tdven_cantpr,tdven_precio) SELECT (factura) as tdven_fkidvt, tdtem_idprod, tdtem_cantid, tdtem_preciv FROM tdtem_tts                  WHERE tdtem_tokuse = token;

               WHILE a <= registros DO
               
                    SELECT cod_prod,cant_prod INTO tmp_cod_producto,tmp_cant_producto FROM tbl_tmp_tokenuser WHERE id = a;
                    SELECT tprod_cantpr INTO existencia_actual FROM tprod_tme WHERE tprod_idprod = tmp_cod_producto;

                    SET nueva_existencia = existencia_actual - tmp_cant_producto;
                    UPDATE tprod_tme SET tprod_cantpr = nueva_existencia WHERE tprod_idprod = tmp_cod_producto;

                    SET a=a+1;

               END WHILE;

               SET total = (SELECT SUM(tdtem_cantid * tdtem_preciv) FROM tdtem_tts WHERE tdtem_tokuse = token);
               UPDATE tvenn_tts SET tvent_totalv = total WHERE tvent_idvent = factura;
               
               UPDATE tdevt_tts SET tdven_Subtot = total WHERE tdven_fkidvt = factura;
               
               DELETE FROM tdtem_tts WHERE tdtem_tokuse = token;
               TRUNCATE TABLE tbl_tmp_tokenuser;
               SELECT * FROM tvenn_tts WHERE tvent_idvent = factura;
           ELSE
               SELECT 0;
           END IF;
      END$$

